import React, { useState } from 'react'
import { Signin, getdata } from './apiCall/api'
import { useDispatch } from 'react-redux'
import { dataRemove } from './Slice'
import { Link } from 'react-router-dom'
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

function SignUp() {
  const [username, setusername] = useState('')
  const [email, setemail] = useState('')
  const [age, setage] = useState(0)
  const [address, setaddress] = useState('')
  const [password, setpassword] = useState('')
  const formdata = new FormData()
  formdata.append('username', username)
  formdata.append('email', email)
  formdata.append('age', age)
  formdata.append('address', address)
  const dispatch = useDispatch()

  const disp = (e) => {
    e.preventDefault()
    // console.log('formdata',formdata);
    // console.log(Name);
    // console.log(email);
    // console.log(password);

    console.log(username, email, age, address);
    Signin({ username, email, age, address, password })

  }
  const gettdata = () => {
    getdata(dispatch)

  }
  const removedata = () => {
    dispatch(dataRemove())
  }
  return (
    <div>
      <div>
        <div>
          <Form >
            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Label>Email address</Form.Label>
              <Form.Control type="email" placeholder="Enter email" />
              <Form.Text className="text-muted">
                We'll never share your email with anyone else.
              </Form.Text>
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
              <Form.Label>Password</Form.Label>
              <Form.Control type="password" placeholder="Password" />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formBasicCheckbox">
              <Form.Check type="checkbox" label="Check me out" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        </div>
      </div>
      <form onSubmit={disp} encType='multipart/form-data'>
        <input type="text" placeholder='username' value={username} onChange={(e) => setusername(e.target.value)} />
        <input type="text" placeholder='email' value={email} onChange={(e) => setemail(e.target.value)} />
        <input type="number" placeholder='age' value={age} onChange={(e) => setage(e.target.value)} />
        <input type="text" placeholder='address' value={address} onChange={(e) => setaddress(e.target.value)} />
        <input type="password" placeholder='password' value={password} onChange={(e) => setpassword(e.target.value)} />
        <input type="submit" />
      </form>

      <button onClick={gettdata}>click gett</button>
      <button onClick={removedata}>click remove</button>
      <Link to={'/'}><button>I have an Account</button></Link>
    </div>
  )
}

export default SignUp
